INSERT INTO `recommendations` (`recommendation_id`, `user_id`, `test_id`, `recommendation`, `created_at`) VALUES
(1, 1, 1, 'Hasil tes anda untuk tanggal 8 Juli 2024 menunjukkan bahwa anda mendapat skor 75 dengan tingkat keparahan moderat. Potensi diagnosa yang dihasilkan adalah Depresi. Rekomendasi dalam kasus ini adalah sebagai berikut:\n\n1. Segera konsultasikan diri anda kepada seorang psikolog atau psikiater terlatih. Mereka akan dapat memberikan penanganan yang lebih rinci dan terarah.\n\n2. Anda dapat mencoba melakukan aktivitas fisik seperti olahraga atau yoga untuk mengurangi stress dan meningkatkan mood.\n\n3. Pastikan anda makan sehat dan cukup. Gizi sebelum dan sesudah makan dapat mempengaruhi mood anda.\n\n4. Hindari asupan alkohol dan narkoba, sebab ini dapat menyebabkan depresi yang lebih parah.\n\n5. Coba mengatur hidup anda dengan rutin yang baik, sehingga tidak terlalu banyak pergeseran jarak.\n\n6. Jadilah aktif dalam mengelola kecemasan dan rasa cemas. Anda dapat mencoba teknik relaksasi seperti meditation atau respirasi dalam nafas panjang.\n\n7. Jangan merasa bersalah atau menyesal, hal ini dapat memperparah rasa depresi.\n\n8. Temukan hobi atau aktivitas yang menyenangkan dan menjadikan diri anda bahagia.\n\nHarap diingat bahwa rekomendasi di atas hanya sebagai panduan umum, dan penanganan yang lebih spesifik harus dilakukan oleh psikolog atau psikiater.', '2024-07-08 13:45:28'),
